import Navbar from "./Navbar";
import styles from "../css/Cart.module.css";
import hubaib from "../images/hubaib.jpg";
import hussain from "../images/hussain.jpeg";
import oStyles from "../css/Orders.module.css";
import React from "react";
import { useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";

function Orders() {
  const navigate = useNavigate();
  const [retProducts, setRetProducts] = useState([]);

  useEffect(() => {
    const apiCall = async () => {
      const getProducts = await fetch(
        "http://localhost:5000/orders/get-order-products",
        {
          method: "GET",
          credentials: "include",
        }
      );

      const data = await getProducts.json();

      if (data.message === "unauthenticate") navigate("/");
      console.log(data);
      setRetProducts(data.cart);
    };
    apiCall();
  }, []);
  return (
    <>
      <Navbar />
      <div className={styles.items_section}>
        {retProducts &&
          retProducts.map((product) => {
            <div className={styles.item} key={product._id}>
              <img
                src={`http://localhost:5000/productImages/${product.imageURL}`}
                alt=""
              />
              <div>
                <p>
                  <strong>Price (pkr): {product.price}</strong> 50
                </p>
                <p>
                  <strong>Quantity: {product.quantity}</strong> 50
                </p>
                <p>
                  <strong>Description:</strong>
                </p>
                <p>{product.description}</p>
                <button className={oStyles.orderBtn}>Pending</button>
              </div>
            </div>;
          })}

        <div className={styles.item}>
          <img src={hussain} alt="" />
          <div>
            <p>
              <strong>Price (pkr):</strong> 50
            </p>
            <p>
              <strong>Description: </strong>
            </p>
            <p>
              Lorem ipsum dolor sit, amet consectetur adipisicing elit.
              Provident voluptatibus voluptatum impedit doloremque quibusdam
              suscipit quo aliquam quos fugiat iusto eius maxime aspernatur ad
              error sunt blanditiis, animi rerum accusamus!
            </p>
            <button className={oStyles.orderBtn}>Complete</button>
          </div>
        </div>

        <div className={styles.item}>
          <img src={hubaib} alt="" />
          <div>
            <p>
              <strong>Price (pkr):</strong> 50
            </p>
            <p>
              <strong>Description: </strong>
            </p>
            <p>
              Lorem ipsum dolor sit, amet consectetur adipisicing elit.
              Provident voluptatibus voluptatum impedit doloremque quibusdam
              suscipit quo aliquam quos fugiat iusto eius maxime aspernatur ad
              error sunt blanditiis, animi rerum accusamus!
            </p>
            <button className={oStyles.orderBtn}>Pending</button>
          </div>
        </div>

        <div className={styles.item}>
          <img src={hussain} alt="" />
          <div>
            <p>
              <strong>Price (pkr):</strong> <span id="price">50</span>
            </p>
            <p>
              <strong>Description: </strong>
            </p>
            <p id="description">
              Lorem ipsum dolor sit, amet consectetur adipisicing elit.
              Provident voluptatibus voluptatum impedit doloremque quibusdam
              suscipit quo aliquam quos fugiat iusto eius maxime aspernatur ad
              error sunt blanditiis, animi rerum accusamus!
            </p>
            <button className={oStyles.orderBtn}>Complete</button>
          </div>
        </div>
      </div>
    </>
  );
}

export default Orders;
